int searchLen(int a)//直接通过状态得数字进行二分查找，直接返回该状态的最短路径长度
{
    int k=0,l=N-1,m;
    while(k<=l)
    {
        m=k+(l-k)/2;
        if(p[m].value==a) return p[m].length;
        else if(p[m].value>a) l=m-1;
        else k=m+1;
    }
    return -1;
}

int main()
{
    int n;
    scanf("%d",&n);
    for(int i=0;i<n;i++)
    {
        int a;
        int v=0;
        for(int i=0;i<8;i++)
        {
            scanf("%d",&a);//输入状态，并用秦九昭算法转化为对应的数字
            v=v*10+a;
        }
        int len=searchLen(v);//通过二分查找找出最短路径长度
        printf("%d\n",len);
    }

    return 0;
}
